import React from "react";
import './App.css';
import cocktails from './data.js';
import './App.css';

export default function RecipeList() {
    return (
      <div>
        <h1>Recipes</h1>
        {cocktails.map(cocktail =>
          <div key={cocktail.id}>
            <h2>{cocktail.name}</h2>
            <img src={cocktail.image} alt={cocktail.name}></img>
            <ul>
              {cocktail.ingredients.map(ingredient =>
                <li key={ingredient}>
                  {ingredient}
                </li>
              )}
            </ul>
            <div>
                {cocktail.recipes.map(recipe =>
                   <p key={recipe}>
                    {recipe}
                    </p> 
                    )}
            </div>
          </div>
        )}
      </div>
    );
  }
